  \"2013-03-14T15:04:13.890693\",\n\t\"name\": \"functional-class-ahtd\",\n\t\"isopen\":
  false,\n\t\"url\": null,\n\t\"notes\": \"This data set contains Functional Classification
  roads for the State of Arkansas per the Arkansas Highway and Transportation Department
  (AHTD). This file should only be used as a graphical representation and for general
  reporting. Field verification and source contact should always occur prior to financial
  planning taking place. Functional classification is the process by which streets
  and highways are grouped into classes, or systems, according to the character of
  service they are intended to provide. Basic to this process is the recognition that
  individual roads and streets do not serve travel independently in any major way.
  Rather, most travel involves movement through a network of roads. It becomes necessary
  then to determine how this travel can be channelized within the network in a logical
  and efficient manner. Functional classification defines the nature of this channelization
  process by defining the part that any particular road or street should play in serving
  the flow of trips through a highway network.\",\n\t\"license_title\": null,\n\t\"extras\":
